                in BuiltinParcelableTypes.IMMUTABLE_LIST_FQNAMES -> IrExtensionFunctionOnReadCallingSerializer(delegated = listSerializer, converterExtensionFunction = symbols.kotlinIterableToPersistentListExtension)
